function FilterStatus() {
  return (
    <div className="btn-group">
      <input type="radio" className="btn-check" name="options" id="all-select"></input>
      <label className="btn btn-dark" for="all-select">
        All
      </label>
      <input type="radio" className="btn-check" name="options" id="danger-outlined"></input>
      <label className="btn btn-outline-dark" for="danger-outlined">
        Danger
      </label>
    </div>
  );
}
export default FilterStatus;
